import Card from './Card';
import styled from 'styled-components';

const Patuta = styled.div`color: brown;
display: flex;
flex-direction: row;
justify-content: space-between;
margin: auto;
padding: 2 em;
border-radius: 15px;`
export default function Cards({characters, onClose}) {
   return (<Patuta>
      {characters.map(char=>{
         return <Card
        char={char}
         onClose={onClose}></Card>
      })
   }
   </Patuta>
)
}
